import { EmptyState, Layout, Page } from '@shopify/polaris';

function Label() {
    return (
        <Page>
            <div className='title'>
                <h1>Vue Nutrition Label</h1>
            </div>

            <div className='content'>
                <Layout>
                    <Layout.Section>
                        <Inputbox />

                    </Layout.Section>
                    <Layout.Section>
                        <View />
                    </Layout.Section>
                    <Layout.Section>
                        <Nutrition />

                    </Layout.Section>

                </Layout>

            </div>
        </Page>);
}

export default Label;
